import './nav.css';
import { NavLink } from 'react-router-dom'
import logo from './images/DuckyLogo.png'

export default function Nav({ isStatic = false }) {
	const breakpoint = useBreakpoint();
	if (breakpoint === BREAKPOINT.MOBILE) {
		return <NavMobile isStatic={isStatic} />;
	}
	const navStyling = isStatic
		? `${styles.navContainer} ${styles.staticNav}`
		: styles.navContainer;

  return (
    <nav className="navStyling">
			<ul className="navLinks">
				<Link href="/" className="linkContainer">
					<li>HOME</li>
				</Link>
				<Link href="/speakers" className={styles.linkContainer}>
					<img className={styles.linkhover} src="/img/redArrow.svg" />
					<li>Speakers</li>
				</Link>
				<Link href="/schedule" className={styles.linkContainer}>
					<img className={styles.linkhover} src="/img/redArrow.svg" />
					<li>Schedule</li>
				</Link>
				{/* {breakpoint !== BREAKPOINT.MIDSIZE && ( */}
				<Link
					href="https://www.eventbrite.com/e/interventions-collide-tickets-802968178437?aff=oddtdtcreator"
					rel="noopener noreferrer"
					target="_blank"
				>
					<li className={styles.tickets}>
						Tickets{" "}
						<img
							className={styles.redArrow}
							src="../img/redArrow.png"
							alt="red arrow"
						/>
					</li>
				</Link>
				{/* )} */}
			</ul>
		</nav>

    // <div className="header">
    //   <nav className="part">
    //     <div className="comp"><NavLink className="link" to="/">HOME</NavLink></div>
    //     <div className="comp"><NavLink className="link" to="/merch">MERCH</NavLink></div>
    //   </nav>
    //   <nav className="part">
    //   <div className="comp"><a href="/"><img className="logo" src={logo} alt="the Ducky Times logo"></img></a></div>
    //   </nav>
    //   <nav className="part">
    //     <div className="comp"><NavLink className="link" to="/signup">SIGNUP</NavLink></div>
    //     <div className="comp"><NavLink className="link" to="/contact">CONTACT</NavLink></div>
    //   </nav>
    // </div>
  );
}
